import React from 'react';
import { 
  Container, 
  Typography, 
  Grid, 
  Card, 
  CardContent, 
  CardActions,
  Button,
  Box,
  IconButton,
  InputAdornment,
  TextField
} from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import PictureAsPdfIcon from '@mui/icons-material/PictureAsPdf';
import SlideshowIcon from '@mui/icons-material/Slideshow';
import DescriptionIcon from '@mui/icons-material/Description';
import DownloadIcon from '@mui/icons-material/Download';
import VisibilityIcon from '@mui/icons-material/Visibility';
import { useNavigate } from 'react-router-dom';

function DocumentList() {
  const navigate = useNavigate();

  const getIcon = (type) => {
    switch(type) {
      case 'pdf':
        return <PictureAsPdfIcon color="error" />;
      case 'presentation':
        return <SlideshowIcon color="primary" />;
      default:
        return <DescriptionIcon color="info" />;
    }
  };

  const documents = [
    { id: 1, name: 'Multi-Point Locks', type: 'pdf', description: 'Essential guidelines for customer service' },
    { id: 2, name: 'Product Video', type: 'presentation', description: 'Detailed product features and specifications' },
    { id: 3, name: 'Adjusting Hoppe Hinges', type: 'document', description: 'Internal policies and procedures' },
    { id: 4, name: 'Andersen Foot Bolt Installation', type: 'pdf', description: 'Workplace safety protocols and procedures' },
    { id: 5, name: 'Andersen Frenchwood Hinges', type: 'presentation', description: 'Advanced sales strategies and methods' },
    { id: 6, name: 'Reachout Replacement', type: 'pdf', description: 'Complete guide for employees' },
    { id: 7, name: 'Andersen Sliding Door Hardware', type: 'document', description: 'Technical specifications and guides' },
    { id: 8, name: 'Onboarding Process', type: 'presentation', description: 'New employee orientation materials' },
    { id: 9, name: 'Quality Standards', type: 'pdf', description: 'Quality assurance guidelines' },
    { id: 10, name: 'Team Building', type: 'presentation', description: 'Team development resources' },
    { id: 11, name: 'Emergency Procedures', type: 'document', description: 'Emergency response protocols' },
    { id: 12, name: 'Best Practices', type: 'pdf', description: 'Industry standard procedures' }
  ];

  return (
    <Container>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 4, mt: 4 }}>
        <Typography variant="h4" component="h1" sx={{ fontWeight: 600 }}>
          Informational Materials
        </Typography>
        <TextField
          placeholder="Search documents..."
          variant="outlined"
          size="small"
          sx={{ width: 300 }}
          InputProps={{
            startAdornment: (
              <InputAdornment position="start">
                <SearchIcon color="action" />
              </InputAdornment>
            ),
          }}
        />
      </Box>

      <Grid container spacing={3}>
        {documents.map((doc) => (
          <Grid item xs={12} sm={6} md={4} key={doc.id}>
            <Card sx={{ 
              height: '100%', 
              display: 'flex', 
              flexDirection: 'column',
              cursor: 'pointer',
              '&:hover': {
                transform: 'translateY(-4px)',
                boxShadow: 3,
                transition: 'transform 0.2s ease-in-out, box-shadow 0.2s ease-in-out'
              }
            }}
            onClick={() => navigate(`/documents/${doc.id}`)}
          >
              <CardContent sx={{ flexGrow: 1 }}>
                <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                  {getIcon(doc.type)}
                  <Typography variant="h6" sx={{ ml: 1 }}>
                    {doc.name}
                  </Typography>
                </Box>
                <Typography color="text.secondary" variant="body2">
                  {doc.description}
                </Typography>
              </CardContent>
              <CardActions sx={{ justifyContent: 'flex-end', p: 2 }}>
                <Button 
                  startIcon={<VisibilityIcon />} 
                  size="small" 
                  color="primary"
                >
                  View
                </Button>
                <Button 
                  startIcon={<DownloadIcon />} 
                  size="small" 
                  color="secondary"
                >
                  Download
                </Button>
              </CardActions>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
}

export default DocumentList;
